import React, {Component} from 'react';
import {Card, Col} from "react-bootstrap";

class Product extends Component {
    constructor(props) {
        super(props);
        this.state = {
            product: []
        }
    }

    render() {
        return (

            <Card className="my-3 p-3 rounded">
                {console.log(this.props.product)}
            </Card>
        );
    }
}

export default Product;
